void narisi_sredino(void) {
	uint8_t w = 240 / (2 * st_crt - 1 );
	uint8_t y;
		for(uint8_t i = 1; i <= (2 * st_crt); i++) {
			y = (i - 1) * w;
			if (i % 2 != 0) {
				UG_FillFrame(159, y, 161, y+w, C_CHOCOLATE);// x, y, h, w, barva
			}
			else {
				UG_FillFrame(159, y, 161, y+w, C_BLACK);
			}
		}
}
