int preveri_zmago(void) {
    // Ta funkcija vrne 1, če je nekdo dosegel 5 točk (rezultat 4)
    if (score_L > 3 || score_D > 3) {
        // NOVO: tukaj lahko napišeš zmagovalca :)
        return 1; // Konec iteracije!
    }
    return 0; // Igra se nadaljuje
}
