void Title_screen_narisi()
{
  	for(uint16_t visina=0;visina<pong_height;visina++)
  	  	{
  	  		for(uint16_t sirina=0;sirina<pong_width;sirina++)  //+=1
  	  		{

  	  		uint32_t index = (visina * pong_width + sirina) * 2;  //Ker vsak piksel zavzema dva mesta v polju moja_slika (ker je polje tipa uint8_t), moramo indeks pomnožiti z 2, da pridemo do začetka naslednjega piksla

  	  		//piksla razbila na dva surova bajta.
  	  		uint8_t byte1 = moja_slika[index];
  	  		uint8_t byte2 = moja_slika[index + 1];

  	  		// Ročno sestavljen 16-bitni piksel 
  	  		uint16_t piksel = (byte1 << 8) | byte2;  // Prvi bajt premaknemo za 8 mest v levo, da postane "zgornji" del 16-bitnega števila,
  	  												 // z ALI pa dodamo drugi bajt na prazna mesta na desni -> rezultat: popolno 16-bitno število/barva

  	  	//Izriši piksel
  	  	UserPixelSetFunction(sirina, visina, piksel);
  	  	//UserPixelSetFunction(sirina, visina, popravljen_piksel);

  	  		}
  	  	}
}
