void Popravi_Ozadje(int16_t x, int16_t y, int16_t r)
{
    // Izračunamo kvadratno območje okoli kroga (žogice)
    // r je radij žogice, dodamo +1 za varnost
	
    int16_t x_start = x - r - 1;
    int16_t y_start = y - r - 1;
    int16_t dimenzija = (r * 2) + 3;

    for (int16_t v = y_start; v < y_start + dimenzija; v++)
    {
        for (int16_t s = x_start; s < x_start + dimenzija; s++)
        {
            // Preverimo robove zaslona
            if (s >= 0 && s < 320 && v >= 0 && v < 240)
            {
                uint32_t index = (v * 320 + s) * 2;
                uint8_t b1 = moja_slika[index];
                uint8_t b2 = moja_slika[index + 1];
                uint16_t piksel = (b1 << 8) | b2;

                UserPixelSetFunction(s, v, piksel);
            }
        }
    }
}
