void Narisi_Zacetni_Meni(int izbrana_opcija) {

    Title_screen_narisi(); //Nariše celo ozadje

    //Nastavitve teksta
    UG_FontSelect(&FONT_16X26);
    UG_FontSetHSpace(0); // Za vsak primer
    UG_FontSetVSpace(0);

    char* opt1 = "START GAME";
    char* opt2 = "MENU";

    // Izračun sredine (320 - (znaki * 16)) / 2
    int x1 = (320 - (10 * 16)) / 2; // START GAME
    int x2 = (320 - (4 * 16)) / 2;  // MENU

    // Opcija 0: START GAME
        if (izbrana_opcija == 0) {
            UG_SetForecolor(C_YELLOW); // Izbrana barva
        } else {
            UG_SetForecolor(C_WHITE);  // Navadna barva
        }
        UG_PutString(x1, 100, "START GAME");

        // Opcija 1: MENU
        if (izbrana_opcija == 1) {
            UG_SetForecolor(C_YELLOW); // Izbrana barva
        } else {
            UG_SetForecolor(C_WHITE);  // Navadna barva
        }
        UG_PutString(x2, 140, "MENU");
    }

